import React from 'react';
import styled from 'styled-components';

const StyledSlideFour = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  .left-column {
    background: #FAC943;
    height: 92vh;
    width: 35vw;
    position: absolute;
    bottom: 0;
    left: 75px;

    .image-wrapper {
      position: absolute;
      top: 40px;
      right: 80px;
      display: inline-block;
      height: 80vh;

      img {
        height: 100%;
        border: black solid 3px;
        border-radius: 30px;
        box-shadow: -12px 13px 27px -8px rgba(0,0,0,0.77);
      }
    }
  }
`;

function SlideFour() {
  return (
    <StyledSlideFour className="slide-four">
      <div className='left-column'>

      </div>
    </StyledSlideFour>
  );
}

export default SlideFour;
